import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const arrayList = ['Acordar cedo', 'Fazer café', 'Programar', 'Chorar', 'Banho', 'Dormir!'];

function App() {
  return (
    arrayList.map((tarefa) => {
     return Task(tarefa)
    })
  )
}

export default App;
